import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import Filter from '../Filter'


//PODE SER CONVERTIDO EM FUNÇÃO EM VEZ DE CLASS
class Material_Managment extends Component {

    constructor (props) {
        super(props)

        this.changeFilter = this.changeFilter.bind(this)
        this.filterMaterial = this.filterMaterial.bind(this)
        this.filterMaterialEvent = this.filterMaterialEvent.bind(this)
        this.resetFilter = this.resetFilter.bind(this)
        this.onSubmit = this.onSubmit.bind(this)
        this.deleteMaterial = this.deleteMaterial.bind(this)
    }

    state = {
        ucs: [{id:"1",name:'Elet'},{id:"2",name:'LIC'}, {id:"3",name:'LSD'}, {id:"4",name:'AC'}],
        acs: [{id:"1",name:'Informática'}, {id:"2",name:'Eletrónica'}],
        types: [{id:"1",name:'ATB'}, {id:"2",name:'PDS16'}, {id:"3",name:'BreadBoard'}, {id:"5",name:'Chips'}, {id:"5",name:'Cabos'}],
        material: [
            {
                id: '01-01-001',
                name: 'ATB_1',
                uni: true,
                type: [{id:"1",name:'ATB'}],
                ucs: [{id:"2",name:'LIC'}, {id:"3",name:'LSD'}],
                acs: [{id:"1",name:'Informática'}]
            }, {
                id: '01-01-002',
                name: 'ATB_2',
                uni: true,
                type: [{id:"1",name:'ATB'}],
                ucs: [{id:"2",name:'LIC'}, {id:"3",name:'LSD'}],
                acs: [{id:"1",name:'Informática'}]
            },
            {
                id: '01-02-001',
                name: 'PDS16_1',
                uni: true,
                type: [{id:"2",name:'PDS16'}],
                ucs: [{id:"4",name:'AC'}],
                acs: [{id:"1",name:'Informática'}]
            },
            {
                id: '01-02-002',
                name: 'PDS16_2',
                uni: true,
                type: [{id:"2",name:'PDS16'}],
                ucs: [{id:"4",name:'AC'}],
                acs: [{id:"1",name:'Informática'}]
            },
            {
                id: '01-03-001',
                name: 'BreadBoard_1',
                uni: true,
                type: [{id:"3",name:'BreadBoard'}],
                ucs: [{id:"3",name:'LSD'}, {id:"1",name:'Elet'}],
                acs: [{id:"1",name:'Informática'}, {id:"2",name:'Eletrónica'}]
            },
            {
                id: '01-03-002',
                name: 'BreadBoard_2',
                uni: true,
                type: [{id:"3",name:'BreadBoard'}],
                ucs: [{id:"3",name:'LSD'}, {id:"1",name:'Elet'}],
                acs: [{id:"1",name:'Informática'}, {id:"2",name:'Eletrónica'}]
            },
            {
                id: '01-04-001',
                name: 'Cabos',
                uni: false,
                type: [{id:"5",name:'Cabos'}],
                ucs: [{id:"1",name:'Elet'},{id:"2",name:'LIC'}, {id:"3",name:'LSD'}, {id:"4",name:'AC'}],
                acs: [{id:"1",name:'Informática'}, {id:"2",name:'Eletrónica'}]
            },
            {
                id: '01-05-001',
                name: 'Chips',
                uni: false,
                type: [{id:"4",name:'Chips'}],
                ucs: [{id:"1",name:'Elet'},{id:"2",name:'LIC'}, {id:"3",name:'LSD'}, {id:"4",name:'AC'}],
                acs: [{id:"1",name:'Informática'}, {id:"2",name:'Eletrónica'}]
            }],
        //representação do filters {type:"ucs",name:"LSD"}


        filters: [],
        filtered: null
    }

    style = {
        display: 'inline-block',
        margin: 10,
        marginBottom: 30
    }

    componentDidMount() {
        if (this.props.location && this.props.location.search) {
            const querystring = new URLSearchParams(this.props.location.search)
            const entries = querystring.entries()
            let next = entries.next()
            let filters = []
            do {
                filters.push({ type: next.value[0], name: next.value[1] })
                next = entries.next()
            } while (!next.done)

            const filtered = this.filterMaterial(filters)
            this.setState({ filtered: filtered, filters: filters })

            const resetButton = document.getElementById("reset_filter")
            resetButton.style.visibility = "visible"
        }
        if (this.props.selectedMaterial != null) {
            const materials = this.props.selectedMaterial()
            materials.map(material => {
                this.selectCheckBox(material)
            })
        }
    }


    filterMaterialEvent(event) {
        event.preventDefault()
        const resetButton = document.getElementById("reset_filter")

        if (this.state.filters.length > 0) {
            const filtered = this.filterMaterial(this.state.filters)
            resetButton.style.visibility = "visible"
            this.setState({ filtered: filtered })
            let search = "?"
            const length = this.state.filters.length
            this.state.filters.map((filter, index) => {
                search += `${filter.type}=${filter.name}`
                if (index + 1 != length) {
                    search += "&"
                }
            })

            this.props.history.push({
                pathname: this.props.location.pathname,
                search: search
            })
        }
    }

    filterMaterial(filters) {
        const filtered = this.state.material.reduce((reduced, material) => {
            let flag = false
            for (let i = 0; i < filters.length; ++i) {
                const filter = filters[i]
                if (!material[filter.type].find(t =>t['id'] === filter.name)) {
                    flag = false
                    break
                }
                else
                    flag = true
            }
            if (flag) {
                reduced.push(material)
            }
            return reduced
        }, [])
        console.log(filtered)

        return filtered
    }

    changeFilter(filter) {
        console.log(filter)
        let newfilter = [...this.state.filters]
        if (filter.name === 'all') {
            newfilter = newfilter.filter(obj => obj.type != filter.type)
        }
        else {
            const index = newfilter.findIndex(obj => obj.type === filter.type)
            if (index === -1)
                newfilter.push(filter)
            else
                newfilter[index] = filter
        }

        this.setState({ filters: newfilter })
    }


    resetFilter(event) {
        event.preventDefault()
        const resetButton = document.getElementById("reset_filter")
        resetButton.style.visibility = "hidden"
        this.props.history.push(this.props.location.pathname)
        this.setState({ filters: [], filtered: null })
    }

    findFilter(type) {
        let filter = this.state.filters.find(f => f.type === type)
        if (filter != undefined) {
            return filter.name
        }
        return 'all'
    }

    createMaterialList() {
        let material = this.state.material
        if (this.state.filtered != null) material = this.state.filtered

        return material.map(material => {
            return <div className="item" key={material.id}>
                <div className="right floated content">
                    <button className="big ui compact icon button" onClick={() => this.deleteMaterial(material.id)}><i className="red close icon"></i></button>
                </div>
                <div className="content">
                    <Link to={this.props.location.pathname + '/' + material.id}>
                        {material.name}
                    </Link>
                </div>
            </div>

        })
    }

    onSubmit() {
        //adicionar novo material

        this.props.history.push('/auth/labmanager/addmateri')
    }

    deleteMaterial(id) {
        let material = this.state.material
        let materials = material.reduce((materials, material) => {
            if (material.id != id) {
                materials.push(material)
            }
            return materials
        }, [])

        //SE FIZER A FILTRAGEM E APAGAR UM ELE NAO SE REFLETE AI SO SE FIZER RESET NO FILTRO PQ EU ESTOU A AFETAR MATERIAL E NAO FILTERED
        //MAS COMO ISTO VAI TER PEDIDOS NAO HA PROBLEMA PQ VOU BUSCAR OUTRA VEZ COM ESSE FILTRO E DEPOIS JA NAO APARECE O MATERIAL

        //fazer pedido de delete
        this.setState({ material: [... materials] })
    }

    render() {
        return (
            <div>
                <h3 className="ui medium header">Material:</h3>

                <form style={{ display: 'center' }}>
                    <div style={this.style}>
                        <Filter changeFilter={this.changeFilter} name="type" title="Tipo" types={this.state.types} value={this.findFilter("type")} />
                    </div>
                    <div style={this.style}>
                        <Filter changeFilter={this.changeFilter} name="ucs" title="UC's" types={this.state.ucs} value={this.findFilter("ucs")} />
                    </div>
                    <div style={this.style}>
                        <Filter changeFilter={this.changeFilter} name="acs" title="Área Cientifica" types={this.state.acs} value={this.findFilter("acs")} />

                    </div>
                    <div className="small ui basic button" onClick={this.filterMaterialEvent}><i className="icon filter alternate"></i>Filtrar</div>
                    <div className="small ui basic button" id="reset_filter" style={{ ...this.style, visibility: "collapse" }} onClick={this.resetFilter}>Reset</div>
                </form>
                <button className="ui medium labeled icon button" onClick={this.onSubmit}><i className="check circle icon"></i>Adicionar Material</button >
                <hr />
                <div className="ui big middle aligned divided list">

                    {
                        this.createMaterialList()
                    }
                </div>

            </div>
        )
    }
}

export default Material_Managment
